import React from 'react';
import Paper from "@material-ui/core/Paper";


function Question(props) {
    const id = props.questionId;
   const q = props.getquestionid(props.id)

    return(
        <Paper>
            <h1>Question Details</h1>
            <p>{q.id}</p>


        </Paper>
    )
}

export default Question;
